import React, { useState, useEffect } from 'react';
import ScanResultList, {ScanResult} from '../components/ScanResultList';
import '../styles/App.css';

const ViewScanResults: React.FC = () => {
  const [results, setResults] = useState<ScanResult[]>([]);

  useEffect(() => {
    // Fetch scan results from the API and set the state
  }, []);

  return (
    <div className="container">
      <h2>Scan Results</h2>
      <ScanResultList results={results} />
    </div>
  );
};

export default ViewScanResults;
